  let SCALE_FACTOR = uniforms[0];
  let WIDTH = uniforms[1];
  let HEIGHT = uniforms[2];
  let OFFSET = i32(uniforms[3]);

  let index = i32(floor(input.pos.x * f32(SCALE_FACTOR)));
